#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#include "auth_ldap.h"

char *progname = "test_get_service_filter";

int test_get_service_filter( char *host, char *user, char *tag, char *match, int out )
{
    char *filter;
    int  result = 0;

    printf( "   get_service_filter( '%s', '%s', '%s', '%s', %i ) ", host, user, tag, match, out );
    filter = get_service_filter( host, user, tag );

    printf( " = '%s' ", filter );

    if ( filter == NULL ) {
        if ( match == NULL ) {
            result = 1;
        } else {
            result = 0;
        }
    } else {
        if ( match != NULL ) {
            if ( strcmp( filter, match ) == 0 ) {
                result = 1;
            }
            free( filter );
        }
    }

    if ( result == out ) {
        printf( " passed\n" );
        return( 0 );
    }
    printf( " failed\n" );
    return( 1 );
}

